      <div className="dropdown-container">
        <ul
          className="dropdown-list"
          onClick={(e) => selected(e, ref)}
          id="nav-list"
          ref={ref}
        >
          <Link to="/home">
            <li id="home">Home</li>
          </Link>
          <Link to="/news">
            <li id="news">News</li>
          </Link>
          <Link to="/login">
            <li id="login">Login</li>
          </Link>
        </ul>
      </div>
    </div>
  );
};

export default NavBarSearch;
